import React from 'react';
import {
    Grid,
    Image,
    CardMeta,
    CardHeader,
    CardDescription,
    CardContent,
    Card,
    Icon,
    Segment,
} from 'semantic-ui-react';

const Teams = () => {
    // Example data array of team members
    const teamMembers = [
        {
            id: 1,
            name: 'Daniel',
            avatar: 'https://react.semantic-ui.com/images/avatar/large/daniel.jpg',
            joinedYear: 2016,
            description: 'Daniel is a comedian living in Nashville.',
            friendsCount: 10,
        },
        {
            id: 2,
            name: 'Ella',
            avatar: 'https://react.semantic-ui.com/images/avatar/large/elliot.jpg',
            joinedYear: 2018,
            description: 'Ella is an artist based in Los Angeles.',
            friendsCount: 8,
        },
        {
            id: 3,
            name: 'Grace',
            avatar: 'https://react.semantic-ui.com/images/avatar/large/daniel.jpg',
            joinedYear: 2017,
            description: 'Grace is a writer from New York City.',
            friendsCount: 12,
        },
        {
            id: 4,
            name: 'John',
            avatar: 'https://react.semantic-ui.com/images/avatar/large/jenny.jpg',
            joinedYear: 2019,
            description: 'John is a software engineer working remotely.',
            friendsCount: 15,
        },
        {
            id: 5,
            name: 'Matthew',
            avatar: 'https://react.semantic-ui.com/images/avatar/large/matthew.png',
            joinedYear: 2015,
            description: 'Matthew is a teacher passionate about education.',
            friendsCount: 7,
        },
        {
            id: 6,
            name: 'Lily',
            avatar: 'https://react.semantic-ui.com/images/avatar/large/daniel.jpg',
            joinedYear: 2020,
            description: 'Lily is a photographer exploring nature photography.',
            friendsCount: 11,
        },
        {
            id: 7,
            name: 'Oliver',
            avatar: 'https://react.semantic-ui.com/images/avatar/large/daniel.jpg',
            joinedYear: 2018,
            description: 'Oliver is a chef experimenting with new cuisines.',
            friendsCount: 9,
        },
        {
            id: 8,
            name: 'Sophia',
            avatar: 'https://react.semantic-ui.com/images/avatar/large/daniel.jpg',
            joinedYear: 2016,
            description: 'Sophia is a marketer passionate about digital trends.',
            friendsCount: 14,
        },
        {
            id: 9,
            name: 'William',
            avatar: 'https://react.semantic-ui.com/images/avatar/large/daniel.jpg',
            joinedYear: 2017,
            description: 'William is an architect designing sustainable buildings.',
            friendsCount: 6,
        },
        {
            id: 10,
            name: 'Ava',
            avatar: 'https://react.semantic-ui.com/images/avatar/large/ade.jpg',
            joinedYear: 2019,
            description: 'Ava is a musician composing her debut album.',
            friendsCount: 13,
        },
    ];

    return (
        <div>
            <Segment inverted color='blue' textAlign='center' style={{ padding: '1rem', marginBottom: '2rem' }}>
                <h1>Teams</h1>
            </Segment>
        <div style={{ marginTop: "5rem", paddingLeft: "5rem", backgroundColor:"lightgrey" }}>
        <Grid columns={5} container doubling stackable>
            {teamMembers.map(member => (
                <Grid.Column key={member.id} style={{ marginBottom: '2rem', marginTop:"2rem" }}>
                    <div className="group overflow-hidden rounded-lg shadow-lg transition duration-300 ease-in-out transform hover:-translate-y-5 hover:shadow-xl cursor-pointer">
                        <Card>
                            <Image src={member.avatar} wrapped ui={false} />
                            <CardContent>
                                <CardHeader>{member.name}</CardHeader>
                                <CardMeta>Joined in {member.joinedYear}</CardMeta>
                                <CardDescription>{member.description}</CardDescription>
                            </CardContent>
                            <CardContent extra>
                                <a>
                                    <Icon name='user' />
                                    {member.friendsCount} Friends
                                </a>
                            </CardContent>
                        </Card>
                    </div>
                </Grid.Column>
            ))}
        </Grid>
    </div>
    </div>
    );
};

export default Teams;
